import React from "react";

/**Import core component (variable)*/
import Select from "../../core/Select";
import { TOP_100_FILMS } from "./films";

export const DEMO = ({
  type,
  view,
  color,
  icon,
  fill,
  centerAlign,
  disabled,
  filterable,
  matchTargetWidth
}) => {

  const showMeItem = item => {
    alert(selectedItem);
  }
  
  return (
    <Select
      type={type}
      view={view}
      color={color}
      icon={icon === true ? "film" : null}
      fill={fill}
      centerAlign={centerAlign}
      filterable={filterable}
      disabled={disabled}
      matchTargetWidth={matchTargetWidth}
      items={TOP_100_FILMS}
      onItemSelect={showMeItem}
    />
  );
};
